import { WomensProduct } from './WomensProduct'

const WomensPage = () => {
  return (
    <div><Navbar/>
    <div className='griid'>
    
        
        <div><SideBar/></div>
        <div><WomensProduct/></div>
    </div></div>
  )
}

export default WomensPage
